import React from 'react';
import "./App.css"

const BucketList = (props) => {
  const my_lists = props.list;
  console.log(my_lists);
  return(
      <div>
         
        <h1>버킷 리스트</h1>
        <li>{props.list}</li>
      </div>
     
  );
}

export default BucketList;
